import React, {useState} from 'react';
import {Form, Input, Dropdown} from 'semantic-ui-react'



export const AddToCart = () => {
	const [newCart, setNewCart] = useState('');


	return (
		<Form>
			<Form.Field>
				<Input 
					placeholder= "cart" 
					value={newCart} 
					onChange={e => setNewCart(e.target.value)}
				/>
			</Form.Field>
			<Form.Field>
				<Dropdown 
					placeholder= "cart" 
					value={newCart} 
					onChange={e => setNewCart(e.target.value)}
				/>
			</Form.Field>
		</Form>	


		)








}
